  "fixed_xml": "<ITEM>30. Weilen mit Ausgang dieses Jahres, auch der gesetzte Praenumerations-Termin auf das <BIBL><TITLE>Picardische Ceremonien-Werck</TITLE></BIBL>, sein Enbe nimmt, welches, wie bekandt, Herr <AUTHOR>David Herrliberger</AUTHOR>, Kupferstecher in Z\u000000fcrich, um einen weit bilichern Prei\u000000df, dem Publico subscribendo l\u000000f4fert, als die ehemalige Holl\u000000e4ndische Edition. Als l\u000000e4sset derselbe solches nochmalen kund machen, weilen nach verflossener Zeit, ein gantzes Ex. emplar von <VOLUME>20.</VOLUME> Ausgaben, mit vollst\u000000e4ndigem Register versehen, nicht anders als vor <PRIZE>fl. 36.</PRIZE> an den Liebhaber verkaufft werden kan. Ummehrerer Deutlichkeit, hat gedachter Herr <AUTHOR>Herrliberger</AUTHOR> beliebet, den gantzen Praenumerations- Prei\u000000df auf folgende Weise nochmals zu notificiren : Die Erste Cla\u000000df, worunter diejenigen Herren Subscribenten verstanden werden, welche gleich im Anfang auf dieses <BIBL><TITLE>Werck</TITLE></BIBL> subscribiret haben, zahlen auf die zweyte und dritte Haubt- Abtheilung, welche noch in <VOLUME>13.</VOLUME> Ausgaben bestehet, vor das erste <PRIZE>fl. 4.</PRIZE> und ferner bey Liefferung einer jeden Ausgave noch nach <PRIZE>51. xr.</PRIZE> da\u000000df also das gantze <BIBL><TITLE>Werck</TITLE></BIBL> ihnen zu stehen kommt \u000000df <PRIZE>fl. 23. 39. xr.</PRIZE> Die Zweyte Cla\u000000df, oder diejenigen, welche die <VOLUME>7.</VOLUME> Ausgaben der Coristlichen K. C. noch nicht haben, und jetzo auf das gantze <BIBL><TITLE>Werck</TITLE></BIBL> praenumeriren, zahlen auch <PRIZE>fl. 4.</PRIZE> so dann vor jede derer <VOLUME>20.</VOLUME> Ausgaben samt Emballage <PRIZE>fl. 1. xr. 12.</PRIZE> macht das gantze <BIBL><TITLE>Werck</TITLE></BIBL> <PRIZE>fl. 28.</PRIZE> Die Dritte Cla\u000000df, oder die so gar nicht Es belieben praenumerirt, zahlen <PRIZE>fl. 36.</PRIZE> also diejenigen Herren Interessenten, welche sich bereits auf dieses <BIBL><TITLE>Werck</TITLE></BIBL> anheischig gemacht, und in der Bischoffischen Buchhandlung darauf praenumerirt, henannte <PRIZE>fl. 4.</PRIZE>, noch in Zeiten einzusenden, weil man nach Verlauff dieses Jahres weiter keine Praenumeration mehr annehmen wird. Basel den <DATE>8ten Dec. 1746.</DATE> Hans Jacob Bischoffs Buchhandlung. <AUTHOR>David Herrliberger</AUTHOR>.</ITEM>",  
